import {CloseBtn, ContCartas} from './styled-components'
export default function Card({name, species, gender, image, onClose}) {
   return (
      <div>
         <CloseBtn onClick={onClose}>X</CloseBtn>
         <h2>{name}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <ContCartas></ContCartas>
         <img src={image} alt={name} />
      </div>
   );
}
